-- ----------------------------
-- Table structure for `gok_hrmianshi`
-- ----------------------------
DROP TABLE IF EXISTS `gok_hrmianshi`;
CREATE TABLE `gok_hrmianshi` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '编号',
  `goutongshijian` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '沟通时间',
  `xingming` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '姓名',
  `xueli` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '学历',
  `biyeyuanxiao` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '毕业院校',
  `zhuanye` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '专业',
  `biyeshijian` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '毕业时间',
  `gongzuonianxian` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '工作年限',
  `qiuzhigangwei` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '求职岗位',
  `xinziyaoqiu` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '薪资要求',
  `lianxifangshi` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '联系方式',
  `dangqianzhuangtai` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '当前状态',
  `qitayaoqiu` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '其他要求',
  `shifoujieshouzhudian` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '是否接受驻点',
  `kezhudianquyu` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '可驻点区域',
  `yaoyueqingkuang` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '邀约情况',
  `tuijianqiye` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '推荐企业',
  `yujidaogangshijian` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '预计到岗时间',
  `mianshijieguo` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '面试结果',
  `qitashuoming` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '其他说明',
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '删除标记（0：正常；1：删除）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

-- ----------------------------
-- Records of gok_hrmianshi
-- ----------------------------

