-- ----------------------------
-- Table structure for `gok_websites`
-- ----------------------------
DROP TABLE IF EXISTS `gok_websites`;
CREATE TABLE `gok_websites` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '编号',
  `parent_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '父级编号',
  `parent_ids` varchar(2000) COLLATE utf8_bin NOT NULL COMMENT '所有父级编号',
  `name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '名称',
  `sort` decimal(10,0) NOT NULL COMMENT '排序',
  `icon` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '图标',
  `title` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '标题',
  `indes` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '锚点',
  `mark` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `tree_leaf` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否树形叶子节点（0:不是,1:是）',
  `url` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '地址',
  `image` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '图片',
  `tree_level` decimal(4,0) DEFAULT NULL COMMENT '树形层级(0:根级)',
  `create_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
