  `job` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '工作内容',
  `ref_doc` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '参考文件',
  `join_time` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '参与时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `sys_menu_parent_id` (`parent_id`) USING BTREE,
  KEY `sys_menu_del_flag` (`del_flag`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='实训流程表';

