  PRIMARY KEY (`id`) USING BTREE,
  KEY `test_data_del_flag` (`del_flag`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='业务数据表';

